import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function AdminNavBar() {
  const [showProductDropdown, setShowProductDropdown] = useState(false);
  const navigate = useNavigate();

  const logout = () => {
    sessionStorage.clear();
    navigate("/");
  };

  const toggleProductDropdown = () => {
    setShowProductDropdown((prev) => !prev);
  };

  const styles = {
    // Admin navbar styles
  };

  return (
    <header style={styles.navbar}>
      <div>Admin Panel</div>
      <nav>
        <button onClick={() => navigate("/admin/User")}>Admin Home</button>
        <button onClick={toggleProductDropdown}>Medicines â–¼</button>
        {showProductDropdown && (
          <div>
            <button onClick={() => navigate("/ad/AddEditMedicine")}>Add/Edit Medicine</button>
            <button onClick={() => navigate("/ListMedicine")}>List Medicines</button>
          </div>
        )}
        <button onClick={logout}>Logout</button>
      </nav>
    </header>
  );
}
